import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import './App.css';
import Footer from './Footer';
import Loader from './Loader';
import Main from './Main';
import Navigation from './Navigation';
import {faCircleArrowUp } from '@fortawesome/free-solid-svg-icons';
import { someFunction } from './AnimatedBackground';

function App() {
  myFunction();
  someFunction();

  return (
    <div className="App darkmode" >
      <canvas id="canvas"></canvas>
      <div class="custom-shape-divider-bottom-1684461056">
    <svg data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="100 -100 1100 300" preserveAspectRatio="none">
    <path d="M1235 347 1234 8Q1135 136 1029 164C800 188 817-19 697-24 546-17 628 181 441 105 261 7 278 324 94 179A600.2 600.2 0 01.1 27.4V120.1L1 347Z" class="shape-fill"></path>
    </svg>
</div>
      <Loader/>
      <Navigation/>
      <a href="home" className="back-to-top-btn btn btn-primary" title="Back to top"><FontAwesomeIcon icon={ faCircleArrowUp} /></a>
      <Main/>
      <Footer/>
    </div>
  );
}

function myFunction() {
  setTimeout(showPage, 1000);
}

function showPage() {
  document.querySelector(".loading-screen").style.display = "none";
}




export default App;
